"cpu": "32",
"memory": "32gb",
"walltime": "5000:00:00"
}
}
```

This script runs the ANGSD program to calculate the site frequency spectrum (SFS) for a population of *Polioptila melanura*. The script uses a reference genome and a list of BAM files for the individuals in the population. 

The script also uses the `realSFS` program to analyze the SFS data. `realSFS` is used to calculate the global SFS, the 2D SFS between populations, and the Fst between populations.

The script is run on a PBS cluster and requires 32 CPUs, 32GB of memory, and a walltime of 5000 hours.
